import { BehaviorSubject, map } from "rxjs";
import { Router } from "@angular/router";
import { NgIf, AsyncPipe, NgForOf, NgSwitch, NgSwitchCase, KeyValuePipe } from "@angular/common";
import { TooltipModule } from "primeng/tooltip";
import { SafePipe } from "~/app/pipes/safe.pipe";

export interface Tool {
  id: string;
  name: string;
  route: string;
  status: ToolStatus;
  svgGenerator: (fill: string) => string;
  group: string;
}

@Component({
    selector: "app-sidebar",
    templateUrl: "./sidebar.component.html",
    styleUrls: ["./sidebar.component.scss"],
    standalone: true,
    imports: [
        NgIf,
        NgForOf,
        NgSwitch,
        NgSwitchCase,
        TooltipModule,
        AsyncPipe,
        KeyValuePipe,
        SafePipe,
    ],
})
export class SidebarComponent implements OnInit {
  @Input() openInNewPage = true;
  @Input() tools: Tool[] = [];
  @Input() collapsed = false;
  @Output() collapsedChange = new EventEmitter<boolean>();

  readonly ToolStatus = ToolStatus;

  selectedTool$ = new BehaviorSubject<string>('');

  groupedTools: { [key: string]: Tool[] } = {};

  fillColorsMap$ = this.selectedTool$.pipe(
    map((selectedToolId) => {
      const disabledColor = "#bdbdbd";
      const activeColor = "#224063";
      const normalColor = "#757575";

      return this.tools.reduce((acc, tool) => {
        const isDisabled = tool.status === ToolStatus.DISABLED;
        const isSelected = tool.id === selectedToolId;
        acc[tool.id] = isDisabled ? disabledColor : isSelected ? activeColor : normalColor;
        return acc;
      }, {} as Record<string, string>);
    })
  );

  constructor(private router: Router) {}

  ngOnInit(): void {
    const url = this.router.url;
    let possibleTool = url.split("/")[1];
    if (possibleTool.indexOf("?") !== -1) {
      possibleTool = possibleTool.split("?")[0];
    }
    this.selectedTool$.next(possibleTool);

    this.groupTools();
  }

  groupTools(): void {
    this.groupedTools = this.tools.reduce((acc, tool) => {
      if (!acc[tool.group]) {
        acc[tool.group] = [];
      }
      acc[tool.group].push(tool);
      return acc;
    }, {} as { [key: string]: Tool[] });
  }

  toggleCollapsed(): void {
    this.collapsedChange.emit(!this.collapsed);
  }
}

import { Injectable } from "@angular/core";
import { HttpClient } from "@angular/common/http";
import {catchError, of} from "rxjs";
import {EnvironmentService} from "./environment.service";
import {EnvVars} from "../models/envvars";

@Injectable({
  providedIn: 'root'
})
export class UserInfoService {
  // TODO: Parameterize these somehow with environment (env.tpl?)

  // Cache our currently logged-in user, or undefined if not logged in
  userInfo?: UserInfo;
  envs: EnvVars;

  constructor(private http: HttpClient, private envService: EnvironmentService) {
    this.envs = this.envService.getEnvConfig();
  }

  /** Fetch userInfo from configured URL */
  fetchUserInfo() {
    const url = this.envs.userInfoUrl;
    this.http.get(url, { withCredentials: true }).pipe(catchError(err => {
      // 401 returned, no user found - login required
      this.userInfo = undefined;
      return of(undefined);
    })).subscribe((value: unknown) => {
      // User was found, meaning the cookie was valid
      this.userInfo = value as UserInfo;
    });
  }

  /** Redirect to configured sign in URL */
  login() {
    window.location.href = this.envs.signInUrl;
  }

  /** Redirect to configured sign out URL */
  logout() {
    window.location.href = this.envs.signOutUrl;
  }
}

export interface UserInfo {
  user: string;              // FIXME: this is currently empty
  email: string;             // user's email address in Keycloak
  preferredUsername: string; // username actually lives here
  groups: Array<string>;     // groups + roles from keycloak
}

import { LocationInner } from './locationInner';


export interface ValidationError { 
    loc: Array<LocationInner>;
    msg: string;
    type: string;
}

